  return (
    <View style={styles.maincontainor} >
        <View style={styles.header}>
            <Text>Happy Monday :)</Text>
        </View>
        <View style={styles.nameTage}>
            <NameTag name='James' days={233} />
        </View>
        <View style={styles.containor}>
            <View style={styles.spaceTaker}>

            </View>
            <View style={styles.catDialog}>
                {/* <Bubble text='Hi!' /> */}
            </View>
        </View>
        <View style={styles.catfood}></View>
        <View style={styles.footer}></View>
    </View>
  )
}

const styles = StyleSheet.create({
    maincontainor: {
        flex: 1,
        flexDirection: 'column',
    },
    header: {
        flex: 3,
        alignItems: 'center',
        justifyContent: 'center',
    },
    containor: {
        flex: 1,
        flexDirection: 'row',
