    nameTage: {
        flex: 1,
        margin: 10,
    },
    containor: {
        flex: 10,
        justifyContent:'center',
        alignItems:'center',
        flexDirection: 'row',
    },
    catDialog: {
        flex: 3,
        alignItems: 'center',
        backgroundColor: 'red',
    },
    spaceTaker: {
        flex: 2,
        backgroundColor: 'blue',
    },
    catfood: {
        flex: 2,
        backgroundColor: 'yellow'
    },
    footer: {
        flex: 2,
        backgroundColor: 'grey'
    },
})


export default ScreenTemplate
